import { baseic } from "./ApiClient";

export const basicAuthentication = (token)=> baseic.get('basicauth',{
    headers:{
        Authorization:token
    }
})

export const basicJWTAuthentication = (UserName,password)=>{ baseic.get('authenticate',{UserName,password})}
